import { Pipe, PipeTransform } from '@angular/core';
import { DropdownOption } from 'src/app/layout/common-layout/model/dynamic-controls/dropdown-options';
import { Config } from 'src/app/layout/common-layout/model/fields/variable/config';
import { OAuth2ConfigSettings } from 'src/app/layout/common-layout/model/fields/variable/config-settings';

@Pipe({
	name: 'connectorAuthConfigsFinder',
	pure: true,
})
export class ConnectorAuthConfigsFinder implements PipeTransform {
	transform(config: Config, allAuthConfigs: Config[] | null): DropdownOption[] {
		if (!allAuthConfigs) return [];
		return allAuthConfigs
			.filter(c => (c.settings as OAuth2ConfigSettings).authUrl === (config.settings as OAuth2ConfigSettings).authUrl)
			.map(c => {
				return { label: c.label, value: `\${configs.${c.key}}` };
			});
	}
}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({ name: 'defaultFalse' })
export class DefaultFalsePipe implements PipeTransform {
	transform(value: boolean | null): boolean {
		return value == null ? false : value;
	}
}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({ name: 'defaultTrue' })
export class DefaultTruePipe implements PipeTransform {
	transform(value: boolean | null): boolean {
		return value == null ? true : value;
	}
}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({ name: 'defaultZero' })
export class DefaultZeroPipe implements PipeTransform {
	transform(value: number | undefined): number {
		return value == null ? 0 : value;
	}
}

import { Pipe, PipeTransform } from '@angular/core';
import { DropdownOption } from '../../../model/dynamic-controls/dropdown-options';

@Pipe({
	name: 'itemText',
	pure: true,
})
export class ItemTextPipe implements PipeTransform {
	transform(value: string | DropdownOption) {
		if (typeof value === 'string') {
			return value;
		}
		return value.label;
	}
}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({ name: 'outputLog' })
export class OutputLogPipe implements PipeTransform {
	transform(value: any | null): string {
		if (value == undefined) {
			return '{}';
		}
		let result = '';
		if (typeof value === 'object') {
			result = JSON.stringify(value, null, 2);
		} else if (this.isJsonString(value)) {
			result = JSON.stringify(JSON.parse(value), null, 2);
		} else {
			result = this.repr(value);
		}
		return result.length > 4098 ? result.substr(0, 4098) + ' (truncated)' : result;
	}

	repr(obj) {
		if (obj == null || typeof obj === 'string' || typeof obj === 'number') return String(obj);
		if (obj.length) return '[' + Array.prototype.map.call(obj, this.repr).join(', ') + ']';
		if (obj instanceof HTMLElement) return '<' + obj.nodeName.toLowerCase() + '>';
		if (obj instanceof Text) return '"' + obj.nodeValue + '"';
		if (obj.toString) return obj.toString();

		return String(obj);
	}

	isJsonString(str) {
		try {
			JSON.parse(str);
		} catch (e) {
			return false;
		}
		return true;
	}
}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({ name: 'rawOutputLog' })
export class RawOutputLogPipe implements PipeTransform {
	transform(value: any | null): string {
		if (value == undefined) {
			return '{}';
		}
		let result = '';
		if (typeof value === 'object') {
			result = JSON.stringify(value, null, 2);
		} else if (this.isJsonString(value)) {
			result = JSON.stringify(JSON.parse(value), null, 2);
		} else {
			result = this.repr(value);
		}
		return result.length > 64000 ? result.substr(0, 64000) + ' (truncated)' : result;
	}

	repr(obj) {
		if (obj == null || typeof obj === 'string' || typeof obj === 'number') return String(obj);
		if (obj.length) return '[' + Array.prototype.map.call(obj, this.repr).join(', ') + ']';
		if (obj instanceof HTMLElement) return '<' + obj.nodeName.toLowerCase() + '>';
		if (obj instanceof Text) return '"' + obj.nodeValue + '"';
		if (obj.toString) return obj.toString();

		return String(obj);
	}

	isJsonString(str) {
		try {
			JSON.parse(str);
		} catch (e) {
			return false;
		}
		return true;
	}
}

