import { Injectable } from '@angular/core';
import { BehaviorSubject, Observable } from 'rxjs';
import { environment } from '../../../../environments/environment';
import { User } from '../model/user.interface';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Router } from '@angular/router';
import { JwtHelperService } from '@auth0/angular-jwt';

@Injectable({
	providedIn: 'root',
})
export class AuthenticationService {
	public currentUserSubject: BehaviorSubject<User | undefined> = new BehaviorSubject<User | undefined>(
		this.currentUser
	);

	private jwtHelper = new JwtHelperService();

	constructor(private router: Router, private http: HttpClient) {}

	get currentUser(): User {
		return JSON.parse(localStorage.getItem(environment.userPropertyNameInLocalStorage) || '{}');
	}

	signIn(request: { email; password }): Observable<HttpResponse<User>> {
		return this.http.post<User>(environment.apiUrl + '/authentication/sign-in', request, {
			observe: 'response',
		});
	}

	signUp(request: { email; password; firstName; lastName }): Observable<HttpResponse<User>> {
		return this.http.post<User>(environment.apiUrl + '/authentication/sign-up', request, {
			observe: 'response',
		});
	}

	sendEmailVerification(request: { email }): Observable<HttpResponse<any>> {
		return this.http.post<void>(environment.apiUrl + '/authentication/send-verification-email', request, {
			observe: 'response',
		});
	}

	sendResetPasswordEmail(request: { email }): Observable<void> {
		return this.http.post<void>(environment.apiUrl + '/authentication/send-reset-password-email', request);
	}

	changePassword(request: { token; newPassword }): Observable<HttpResponse<any>> {
		return this.http.post<void>(environment.apiUrl + '/authentication/change-password', request, {
			observe: 'response',
		});
	}

	saveToken(response: HttpResponse<any>) {
		localStorage.setItem(environment.jwtTokenName, <string>response.headers.get('Authorization'));
	}
	saveUser(response: HttpResponse<any>) {
		this.saveToken(response);
		this.updateUser(response.body);
	}

	updateUser(user: User) {
		localStorage.setItem(environment.userPropertyNameInLocalStorage, JSON.stringify(user));
		this.currentUserSubject.next(user);
	}

	isLoggedIn() {
		let jwtToken: any = localStorage.getItem(environment.jwtTokenName);
		if (jwtToken == null) {
			jwtToken = undefined;
		}
		try {
			if (jwtToken && this.jwtHelper.isTokenExpired(jwtToken)) {
				this.logout();
				return false;
			}
		} catch (exception_var) {
			this.logout();
			return false;
		}
		return localStorage.getItem(environment.jwtTokenName) != null;
	}

	logout(): void {
		localStorage.removeItem(environment.jwtTokenName);
		localStorage.removeItem(environment.userPropertyNameInLocalStorage);
		this.currentUserSubject.next(undefined);
		this.router.navigate(['sign-in']);
	}
}

import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { environment } from '../../../../environments/environment';
import * as JSZip from 'jszip';
import { catchError, from, map, Observable, of, switchMap, tap } from 'rxjs';
import { Artifact } from '../model/artifact.interface';
import { UUID } from 'angular2-uuid';
import { ArtifactCacheKey, CollectionConfigsCacheKey, FlowConfigsCacheKey, StepCacheKey } from './artifact-cache-key';
import { CodeTestExecutionResult } from '../../common-layout/model/flow-builder/code-test-execution-result';
import { ArtifactAndItsNameInFormData } from '../../common-layout/model/helper/artifacts-zipping-helper';

type NpmPkg = {
	'dist-tags': {
		latest: string;
	};
};
type PackageName = string;
type PackageVersion = string;
type ArtifactCacheResult = {
	artifact: Artifact;
	needsToBeUploadedToServer: boolean;
};

type ArtifactsCache = Map<string, ArtifactCacheResult>;

@Injectable({
	providedIn: 'root',
})
export class CodeService {
	artifactsCacheForFlowConfigs: ArtifactsCache = new Map();
	artifactsCacheForCollectionConfigs: ArtifactsCache = new Map();
	artifactsCacheForSteps: ArtifactsCache = new Map();
	cachedFile: Map<String, any> = new Map<String, any>();

	constructor(private http: HttpClient) {}

	public beautifyJson(content: any) {
		return JSON.stringify(content, null, 2);
	}

	private downloadFile(url: string) {
		if (this.cachedFile[url] == null) {
			this.cachedFile[url] = this.http.get(url, {
				responseType: 'arraybuffer',
			});
		}
		return this.cachedFile[url];
	}

	executeTest(artifact: Artifact, context: any): Observable<CodeTestExecutionResult> {
		const formData = new FormData();
		const zippedFile$ = CodeService.zipFile(artifact);
		return zippedFile$.pipe(
			switchMap(zippedFile => {
				let file = new File([new Blob([zippedFile])], 'artifact.zip');
				formData.append('artifact', file);
				formData.append('input', new Blob([JSON.stringify(context)], { type: 'application/json' }));
				return this.http.post<CodeTestExecutionResult>(environment.apiUrl + '/execute-code', formData);
			})
		);
	}

	public dynamicDropdownDefaultArtifact(): Artifact {
		return {
			content:
				'exports.codePiece = async (params) => {\n    // You can use params.key to refer to another config variable\n    // Please check the following Slack `Select Channel` example:\n    // https://docs.activepieces.com/guides/create-an-integration/create-flow#add-config-variable\n    \n    return {\n        disabled: false,\n        placeholder: "Select an options",\n        options: [\n            { value: "1", option: "Option 1" },\n            { value: "2", option: "Option 2" }\n        ]\n    };\n};',
			package: '{\n' + '  "dependencies": {\n' + '  }\n' + '}\n',
		};
	}
	public helloWorld(): Artifact {
		return {
			content: 'exports.codePiece = async (params) => {\n' + '    return true;\n' + '};\n',
			package: '{\n' + '  "dependencies": {\n' + '  }\n' + '}\n',
		};
	}

	static zipFile(artifact: Artifact): Observable<string | Uint8Array> {
		const zip = new JSZip();
		zip.folder('build');
		zip.file('build/index.js', artifact.content, {
			createFolders: false,
		});
		zip.file('build/package.json', artifact.package, {
			createFolders: false,
		});

		if (JSZip.support.uint8array) {
			return from(zip.generateAsync({ type: 'uint8array' }));
		} else {
			return from(zip.generateAsync({ type: 'string' }));
		}
	}

	public readFile(filename: string): Observable<Artifact> {
		return this.downloadFile(filename).pipe(
			switchMap(async file => {
				let content = { content: '', package: '' };
				// @ts-ignore
				let zipFile = await JSZip.loadAsync(file);
				for (const filename1 of Object.keys(zipFile.files)) {
					if (filename1.split('/').length > 2) continue;
					if (filename1.endsWith('index.js') || filename1.endsWith('package.json')) {
						let fileData = await zipFile.files[filename1].async('string');
						if (filename1.endsWith('index.js')) {
							content.content = fileData;
						} else if (filename1.endsWith('package.json')) {
							content.package = fileData;
						}
					}
				}
				return content;
			})
		);
	}

	getNpmPackage(npmName: string): Observable<NpmPkg> {
		return this.http.get<NpmPkg>('https://registry.npmjs.org/' + npmName, undefined);
	}

	getLatestVersionOfNpmPackage(npmName: string): Observable<{ [key: PackageName]: PackageVersion } | null> {
		return this.getNpmPackage(npmName).pipe(
			map(pkg => {
				const pkgJson = {};
				pkgJson[npmName] = pkg['dist-tags'].latest;
				return pkgJson;
			}),
			catchError(() => {
				return of(null);
			})
		);
	}

	private getArtifactFromCache(
		artifactsCache: ArtifactsCache,
		artifactKey: string,
		artifactUrl: string,
		uploadNewArtifacts: boolean = true
	) {
		const artifactCacheResult = artifactsCache.get(artifactKey);
		if (artifactCacheResult) {
			return of(artifactCacheResult.artifact);
		} else if (artifactUrl) {
			return this.readFile(artifactUrl).pipe(
				tap(artifact => {
					artifactsCache.set(artifactKey, { artifact: artifact, needsToBeUploadedToServer: false });
				})
			);
		}
		//In case this is a newly added code step/config :D
		artifactsCache.set(artifactKey, { artifact: this.helloWorld(), needsToBeUploadedToServer: uploadNewArtifacts });
		return of(this.helloWorld());
	}

	getOrCreateStepArtifact(stepCacheKey: StepCacheKey, artifactUrl: string) {
		return this.getArtifactFromCache(this.artifactsCacheForSteps, stepCacheKey.toString(), artifactUrl);
	}

	private removeFromCache(artifactsCache: ArtifactsCache, artifactKey: string) {
		artifactsCache.delete(artifactKey);
	}

	removeArtifactInFlowStepsCache(artifactKey: StepCacheKey) {
		this.removeFromCache(this.artifactsCacheForSteps, artifactKey.toString());
	}

	private updateArtifactInCache(artifactsCache: ArtifactsCache, artifactKey: string, artifact: Artifact) {
		const cacheResult = artifactsCache.get(artifactKey);
		if (!cacheResult) {
			throw new Error(`trying to update an empty artifacts' cache entry,  ${artifactKey}`);
		}
		cacheResult.needsToBeUploadedToServer = true;
		cacheResult.artifact = artifact;
	}

	updateArtifactInFlowStepsCache(artifactKey: StepCacheKey, artifact: Artifact) {
		this.updateArtifactInCache(this.artifactsCacheForSteps, artifactKey.toString(), artifact);
	}
	updateArtifactInFlowConfigsCache(artifactKey: FlowConfigsCacheKey, artifact: Artifact) {
		this.updateArtifactInCache(this.artifactsCacheForFlowConfigs, artifactKey.toString(), artifact);
	}
	updateArtifactInCollectionConfigsCache(artifactKey: CollectionConfigsCacheKey, artifact: Artifact) {
		this.updateArtifactInCache(this.artifactsCacheForSteps, artifactKey.toString(), artifact);
	}
	private getDirtyArtifactsFromCache(cache: ArtifactsCache, incompleteArtifactKey: ArtifactCacheKey) {
		const dirtyArtifacts: ArtifactAndItsNameInFormData[] = [];
		const getArtifactNameMethod = CodeService.getArtifactNameMethod(incompleteArtifactKey);
		cache.forEach((cacheResult, key) => {
			if (key.startsWith(`${incompleteArtifactKey.toString()}`) && cacheResult.needsToBeUploadedToServer) {
				const artifactAndName = { artifact: cacheResult.artifact, name: getArtifactNameMethod(key) };
				dirtyArtifacts.push(artifactAndName);
			}
		});
		return dirtyArtifacts;
	}
	private static getArtifactNameMethod(artifactCacheKey: ArtifactCacheKey) {
		if (artifactCacheKey instanceof StepCacheKey) {
			return StepCacheKey.getStepName;
		} else if (artifactCacheKey instanceof FlowConfigsCacheKey) {
			return FlowConfigsCacheKey.getConfigKey;
		} else if (artifactCacheKey instanceof CollectionConfigsCacheKey) {
			return CollectionConfigsCacheKey.getConfigKey;
		}
		throw new Error('Aritfact cache key type has no method to get artifact name');
	}

	getDirtyArtifactsForFlowSteps(flowId: UUID) {
		return this.getDirtyArtifactsFromCache(this.artifactsCacheForSteps, new StepCacheKey(flowId, ''));
	}
	private unmarkDirtyArtifacts(cache: ArtifactsCache, incompleteArtifactKey: ArtifactCacheKey) {
		cache.forEach((result, key) => {
			if (key.startsWith(`${incompleteArtifactKey.toString()}`)) {
				result.needsToBeUploadedToServer = false;
			}
		});
	}

	unmarkDirtyArtifactsInCollectionConfigsCache(collectionId: UUID) {
		this.unmarkDirtyArtifacts(this.artifactsCacheForCollectionConfigs, new CollectionConfigsCacheKey(collectionId, ''));
	}
	unmarkDirtyArtifactsInFlowStepsCache(flowId: UUID) {
		this.unmarkDirtyArtifacts(this.artifactsCacheForCollectionConfigs, new StepCacheKey(flowId, ''));
	}
}

import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { environment } from '../../../../environments/environment';
import { Collection, CollectionVersion } from '../model/piece.interface';
import { forkJoin, Observable, switchMap, tap } from 'rxjs';
import { SeekPage } from './seek-page';
import { UUID } from 'angular2-uuid';
import { PieceAccess } from '../model/enum/piece-access';
import { Config } from '../model/fields/variable/config';

import {
	addArtifactsToFormData,
	ArtifactAndItsNameInFormData,
	zipAllArtifacts,
} from '../model/helper/artifacts-zipping-helper';
import { CodeService } from '../../flow-builder/service/code.service';
import { ConfigType, DropdownType } from '../model/enum/config.enum';
import { DynamicDropdownSettings } from '../model/fields/variable/config-settings';

@Injectable({
	providedIn: 'root',
})
export class CollectionService {
	constructor(private http: HttpClient, private codeService: CodeService) {}

	create(
		projectId: UUID,
		piece: {
			name: string;
			version: {
				displayName: string;
				description: string;
				configs: Config[];
				access: PieceAccess;
			};
		}
	): Observable<Collection> {
		let formData = new FormData();
		formData.append('collection', new Blob([JSON.stringify(piece)], { type: 'application/json' }));
		return this.http.post<Collection>(environment.apiUrl + '/projects/' + projectId + '/collections', formData);
	}

	update(collectionId: UUID, collection: CollectionVersion, logo?: File): Observable<Collection> {
		let formData = new FormData();
		if (logo != undefined) {
			formData.append('logo', logo);
		}
		formData.append('collection', new Blob([JSON.stringify(collection)], { type: 'application/json' }));
		const artifactsAndTheirNames: ArtifactAndItsNameInFormData[] = [
			...this.getDynamicDropdownConfigsArtifacts(collection),
		];

		const updatePiece$ = this.http.put<Collection>(environment.apiUrl + '/collections/' + collectionId, formData);
		const artifacts$ = zipAllArtifacts(artifactsAndTheirNames);
		if (artifacts$.length == 0) return updatePiece$;
		return forkJoin(artifacts$).pipe(
			tap(zippedFilesAndTheirNames => {
				addArtifactsToFormData(zippedFilesAndTheirNames, formData);
			}),
			switchMap(() => {
				return updatePiece$;
			}),
			tap(() => {
				this.codeService.unmarkDirtyArtifactsInCollectionConfigsCache(collectionId);
			})
		);
	}

	getVersion(versionId: UUID): Observable<CollectionVersion> {
		return this.http.get<CollectionVersion>(environment.apiUrl + '/collection-versions/' + versionId);
	}

	listVersions(pieceId: UUID): Observable<CollectionVersion[]> {
		return this.http.get<CollectionVersion[]>(environment.apiUrl + '/collections/' + pieceId + '/versions/', {});
	}

	lock(pieceId: UUID): Observable<Collection> {
		return this.http.post<Collection>(environment.apiUrl + '/collections/' + pieceId + '/commit', {});
	}

	get(pieceId: UUID): Observable<Collection> {
		return this.http.get<Collection>(environment.apiUrl + '/collections/' + pieceId);
	}

	list(projectId: string, limit: number): Observable<SeekPage<Collection>> {
		return this.http.get<SeekPage<Collection>>(
			environment.apiUrl + '/projects/' + projectId + '/collections?limit=' + limit
		);
	}

	archive(pieceId: UUID): Observable<void> {
		return this.http.delete<void>(environment.apiUrl + '/collections/' + pieceId);
	}

	getDynamicDropdownConfigsArtifacts(collection: CollectionVersion) {
		const artifacts: ArtifactAndItsNameInFormData[] = [];
		collection.configs.forEach(config => {
			const settings = config.settings as DynamicDropdownSettings;
			if (config.type === ConfigType.DROPDOWN && settings.dropdownType == DropdownType.DYNAMIC) {
				if (settings.artifactContent) artifacts.push({ artifact: settings.artifactContent, name: config.key });
			}
		});
		return artifacts;
	}
}

import { HttpClient } from '@angular/common/http';
