import { Injectable } from '@angular/core';
import { Actions, createEffect, ofType } from '@ngrx/effects';
import { filter, forkJoin, map, mergeMap, of, pipe, switchMap } from 'rxjs';

import { CollectionService } from 'src/app/layout/common-layout/service/collection.service';
import { ActionMetaService } from '../../service/action-meta.service';
import { FlowItemDetailsActions } from '../action/flow-items-details.action';

@Injectable()
export class FlowItemsDetailsEffects {
	load$ = createEffect(() => {
		return this.actions$.pipe(
			ofType(FlowItemDetailsActions.loadFlowItemsDetails),
			switchMap(() => {
				const coreFlowItemsDetails$ = this.flowItemsDetailsService
					.getDetailsForCollectionsWeBuilt()
					.pipe(
						map(collectionsWeBuiltDetails => [
							...collectionsWeBuiltDetails,
							...this.flowItemsDetailsService.coreFlowItemsDetails,
						])
					);
				const triggerFlowItemsDetails$ = of(this.flowItemsDetailsService.triggerItemsDetails);
				const connectorsFlowItemsDetails$ = this.flowItemsDetailsService.getConnectorsFlowItemsDetails();
				const userCollectionsFlowItemsDetails$ = this.flowItemsDetailsService
					.getFlowItemDetailsForUserCollections()
					.pipe(
						filter(res => {
							if (res) return true;
							return false;
						})
					);

				return forkJoin({
					coreFlowItemsDetails: coreFlowItemsDetails$,
					triggerFlowItemsDetails: triggerFlowItemsDetails$,
					connectorsFlowItemsDetails: connectorsFlowItemsDetails$,
					userCollectionsFlowItemsDetails: userCollectionsFlowItemsDetails$,
				});
			}),
			pipe(
				switchMap(allFlowItemsDetails => {
					return of(
						FlowItemDetailsActions.flowItemsDetailsLoadedSuccessfully({
							flowItemsDetailsLoaded: { loaded: true, ...allFlowItemsDetails },
						})
					);
				})
			)
		);
	});
	loadOldRemoteFlowItemDetails$ = createEffect(() => {
		return this.actions$.pipe(
			ofType(FlowItemDetailsActions.loadOldRemoteFlowItemDetails),
			mergeMap(({ collectionVersionId }) => {
				return this.collectionService.getVersion(collectionVersionId).pipe(
					this.flowItemsDetailsService.mapCollectionVersionToFlowItemDetails,
					switchMap(oldRemoteFlowItemDetails => {
						oldRemoteFlowItemDetails.extra!.old = true;
						return of(
							FlowItemDetailsActions.oldRemoteFlowItemDetailsLoadedSuccessfully({
								oldRemoteFlowItemDetails: oldRemoteFlowItemDetails,
							})
						);
					})
				);
			})
		);
	});
	constructor(
		private actions$: Actions,
		private flowItemsDetailsService: ActionMetaService,
		private collectionService: CollectionService
	) {}
}

import { Injectable } from '@angular/core';
import { BehaviorSubject, Subject } from 'rxjs';
import { Point } from '../../common-layout/model/helper/point';
import { AddButtonAndFlowItemNameContainer } from '../../common-layout/model/flow-builder/flow-add-button';
import { FlowRenderUtil } from './flowRenderUtil';

import { FlowItem } from '../../common-layout/model/flow-builder/flow-item';

@Injectable({
	providedIn: 'root',
})
export class FlowRendererService {
	debuggerNewDropPointSubject = new Subject<{ x: number; y: number }>();
	draggingSubject = new Subject<boolean>();
	public structureChanged: BehaviorSubject<FlowItem | undefined> = new BehaviorSubject<FlowItem | undefined>(undefined);
	public addButtonsWithStepNamesContainers: AddButtonAndFlowItemNameContainer[] = [];
	public rootPiece: FlowItem;
	public attachmentCandidate: BehaviorSubject<AddButtonAndFlowItemNameContainer | undefined> = new BehaviorSubject<
		AddButtonAndFlowItemNameContainer | undefined
	>(undefined);
	private droppedPiece: FlowItem | null;
	candidateAddButton: AddButtonAndFlowItemNameContainer | undefined;
	constructor() {}

	public getDraggedInformation(): {
		draggedPiece: FlowItem | null;
		candidateAddButton: AddButtonAndFlowItemNameContainer | undefined;
	} {
		return {
			draggedPiece: this.droppedPiece,
			candidateAddButton: this.candidateAddButton,
		};
	}

	public setDropPoint(point: Point, draggedPiece: FlowItem) {
		this.droppedPiece = draggedPiece;
		this.debuggerNewDropPointSubject.next(point);
		this.candidateAddButton = this.findCandidateButton(point);
	}

	public setDragPiece(draggedPiece: FlowItem) {
		this.droppedPiece = draggedPiece;
	}

	public refreshCoordinatesAndSetActivePiece(clonedActivePiece: FlowItem | undefined): void {
		if (clonedActivePiece) {
			clonedActivePiece.xOffset = clonedActivePiece.yOffset = 0;
			this.rootPiece = clonedActivePiece;
			FlowRenderUtil.buildBoxes(clonedActivePiece);
			FlowRenderUtil.buildCoordinates(clonedActivePiece);
		}

		this.structureChanged.next(clonedActivePiece);
	}

	private findCandidateButton(dropPoint: Point): AddButtonAndFlowItemNameContainer | undefined {
		let candidate: AddButtonAndFlowItemNameContainer | undefined = undefined;
		this.addButtonsWithStepNamesContainers.forEach(btn => {
			if (btn.stepName !== this.droppedPiece?.name) {
				if (FlowRenderUtil.isButtonWithinCandidateDistance(btn, dropPoint)) {
					if (!candidate) {
						candidate = btn;
					} else {
						const distanceBetweenCandidateAndDropPoint = FlowRenderUtil.dist(
							dropPoint,
							candidate.htmlElementForButton.getBoundingClientRect()
						);
						const distanceBetweenBtnAndDropPoint = FlowRenderUtil.dist(
							dropPoint,
							btn.htmlElementForButton.getBoundingClientRect()
						);
						if (distanceBetweenBtnAndDropPoint < distanceBetweenCandidateAndDropPoint) {
							candidate = btn;
						}
					}
				}
			}
		});
		if (candidate) console.log((candidate as AddButtonAndFlowItemNameContainer).htmlElementForButton);
		return candidate;
	}
}

