import { Injectable } from '@angular/core';
import { Actions, concatLatestFrom, createEffect, ofType } from '@ngrx/effects';
import {
	catchError,
	concatMap,
	EMPTY,
	groupBy,
	mergeMap,
	Observable,
	of,
	switchMap,
	tap,
	throttle,
	throwError,
} from 'rxjs';
import { map } from 'rxjs/operators';
import { Store } from '@ngrx/store';
import { FlowsActions, SingleFlowModifyingState } from '../action/flows.action';
import { FlowService } from '../../../common-layout/service/flow.service';
import { PieceBuilderService } from '../../service/piece-builder.service';
import { MatSnackBar } from '@angular/material/snack-bar';
import { BuilderSelectors } from '../selector/flow-builder.selector';
import { RightSideBarType } from '../../../common-layout/model/enum/right-side-bar-type.enum';
import { LeftSideBarType } from '../../../common-layout/model/enum/left-side-bar-type.enum';
import { TriggerType } from '../../../common-layout/model/enum/trigger-type.enum';
import { TestRunBarComponent } from '../../page/flow-builder/test-run-bar/test-run-bar.component';
import { UUID } from 'angular2-uuid';
import { Flow } from 'src/app/layout/common-layout/model/flow.class';
import { Trigger } from 'src/app/layout/common-layout/model/flow-builder/trigger/trigger.interface';
import { InstanceRun } from 'src/app/layout/common-layout/model/instance-run.interface';
import { BuilderActions } from '../action/builder.action';
import { CodeService } from '../../service/code.service';
import { StepCacheKey } from '../../service/artifact-cache-key';
import { TabState } from '../model/tab-state';
import { findRefreshedConfig } from './helper';
import { VersionEditState } from 'src/app/layout/common-layout/model/enum/version-edit-state.enum';
import { CollectionService } from 'src/app/layout/common-layout/service/collection.service';

@Injectable()
export class FlowsEffects {
	// We cannot merge deleteFlow with SingleFlowModifyingState,
	// as usage of current flow selector to fetch flow id
	// but after deletion instantly this will be another flow after deleted flow.
	startDeleteFlow$ = createEffect(() => {
		return this.actions$.pipe(
			ofType(FlowsActions.deleteFlow),
			concatMap(action => {
				let genSavedId = UUID.UUID();
				return of(FlowsActions.deleteFlowStarted({ flowId: action.flowId, saveId: genSavedId }));
			})
		);
	});

	deleteStepArtifactFromCache = createEffect(
		() => {
			return this.actions$.pipe(
				ofType(FlowsActions.deleteStep),
				concatLatestFrom(() => [this.store.select(BuilderSelectors.selectCurrentFlow)]),
				concatMap(([action, flow]) => {
					if (flow === undefined) {
						return throwError(() => new Error('Internal error, current flow cannot be selected when deleting step'));
					}
					this.codeService.removeArtifactInFlowStepsCache(new StepCacheKey(flow.id, action.stepName));
					return of(void 0);
				})
			);
		},
		{
			dispatch: false,
		}
	);

	startSaveFlow$ = createEffect(() => {
		return this.actions$.pipe(
			ofType(...SingleFlowModifyingState),
			concatLatestFrom(action => [
				this.store.select(BuilderSelectors.selectCurrentFlow),
				this.store.select(BuilderSelectors.selectCurrentCollection),
			]),
			concatMap(([action, flow, collection]) => {
				if (collection.lastVersion.state === VersionEditState.LOCKED) {
					return this.collectionService.update(collection.id, collection.lastVersion).pipe(
						map(() => {
							let genSavedId = UUID.UUID();
							return FlowsActions.saveFlowStarted({ flow: flow!, saveId: genSavedId });
						})
					);
				} else {
					let genSavedId = UUID.UUID();
					return of(FlowsActions.saveFlowStarted({ flow: flow!, saveId: genSavedId }));
				}
			})
		);
	});

	saveFlowStarted$ = createEffect(
		() => {
			return this.actions$.pipe(
				ofType(FlowsActions.saveFlowStarted),
				groupBy(action => action.flow.id),
				mergeMap(changeFlowPendingAction$ => {
					return changeFlowPendingAction$.pipe(
						concatLatestFrom(action => [
							this.store.select(BuilderSelectors.selectFlow(action.flow.id)),
							this.store.select(BuilderSelectors.selectTabState(action.flow.id)),
						]),
						throttle(
							([action, flow, tabState]) => {
								if (flow === undefined || tabState === undefined) {
									return throwError(() => new Error('Flow is not selected'));
								}

								return this.processFlowUpdate({ flow: flow, tabState: tabState, saveId: action.saveId });
							},
							{ trailing: true, leading: true }
						),
						catchError(e => {
							console.error(e);
							const shownBar = this.snackBar.open(
								'You have unsaved changes on this page due to network disconnection.',
								'Refresh',
								{ duration: undefined, panelClass: 'error' }
							);
							shownBar.afterDismissed().subscribe(() => location.reload());
							return of(FlowsActions.savedFailed(e));
						})
					);
				})
			);
		},
		{ dispatch: false }
	);

	private processFlowUpdate(request: { flow: Flow; tabState: TabState; saveId: UUID }): Observable<Flow> {
		return this.flowService.update(request.flow.id, request.flow.lastVersion).pipe(
			tap(updatedFlow => {
				this.store.dispatch(FlowsActions.savedSuccess({ saveId: request.saveId, flow: updatedFlow }));
				let now = new Date();
				let nowDate = now.toLocaleDateString('en-us', {
					month: 'long',
					day: 'numeric',
					year: 'numeric',
				});
				let nowTime = `${now.getHours().toString().padEnd(2, '0')}:${now.getMinutes().toString().padStart(2, '0')}`;
				this.pieceBuilderService.lastSuccessfulSaveDate = `Last saved on ${nowDate} at ${nowTime}.`;
			})
		);
	}

	deleteConfig$ = createEffect(() => {
		return this.actions$.pipe(
			ofType(FlowsActions.deleteConfig),
			concatLatestFrom(action => [
				this.store.select(BuilderSelectors.selectCurrentFlow),
				this.store.select(BuilderSelectors.selectCurrentCollection),
			]),
			concatMap(([action, flow, collection]) => {
				if (flow && collection) {
					const configToDelete = flow.lastVersion.configs[action.configIndex];
					const allConfigs = [...flow.lastVersion.configs, ...collection.lastVersion.configs];
					const refreshedConfig = findRefreshedConfig(allConfigs, configToDelete);
					if (refreshedConfig) {
						return of(
							FlowsActions.deleteConfigFailed({
								referenceKey: configToDelete.key,
								refreshedKey: refreshedConfig.key,
							})
						);
					}
					return of(FlowsActions.deleteConfigSucceeded({ configIndex: action.configIndex }));
				}

				return EMPTY;
			}),
			catchError(error => {
				return of(FlowsActions.savedFailed(error));
			})
		);
	});
	deleteConfigFailed$ = createEffect(
		() => {
			return this.actions$.pipe(
				ofType(FlowsActions.deleteConfigFailed),
				tap(action => {
					this.snackBar.open(`This variable can't be deleted because it's a refresher for ${action.refreshedKey}`, '', {
						panelClass: 'error',
						duration: 5000,
					});
				})
			);
		},
		{ dispatch: false }
	);

	deleteFlowStarted$ = createEffect(() => {
		return this.actions$.pipe(
			ofType(FlowsActions.deleteFlowStarted),
			concatMap((action: { flowId: UUID; saveId: UUID }) => {
				return this.flowService.delete(action.flowId).pipe(
					map(() => {
						return FlowsActions.deleteSuccess({ saveId: action.saveId });
					})
				);
			}),
			catchError(error => of(FlowsActions.savedFailed(error)))
		);
	});

	loadInitial$ = createEffect(() => {
		return this.actions$.pipe(
			ofType(BuilderActions.loadInitial),
			map(({ flows, run }: { flows: Flow[]; run: InstanceRun | undefined }) => {
				return FlowsActions.setInitial({
					flows: flows,
					run: run,
				});
			})
		);
	});

	addFlow$ = createEffect(() => {
		return this.actions$.pipe(
			ofType(FlowsActions.addFlow),
			switchMap((action: { flow: Flow }) => {
				return of(FlowsActions.selectFlow({ flowId: action.flow.id }));
			})
		);
	});

	removePieceSelection = createEffect(() => {
		return this.actions$.pipe(
			ofType(FlowsActions.setRightSidebar),
			concatLatestFrom(() => this.store.select(BuilderSelectors.selectCurrentStepName)),
			switchMap(
				([{ sidebarType }, stepName]: [request: { sidebarType: RightSideBarType }, stepName: string | undefined]) => {
					if (sidebarType !== RightSideBarType.EDIT_STEP && stepName != undefined) {
						return of(FlowsActions.deselectStep());
					}
					return EMPTY;
				}
			)
		);
	});

	replaceTrigger = createEffect(() => {
		return this.actions$.pipe(
			ofType(FlowsActions.replaceTrigger),
			switchMap((params: { newTrigger: Trigger }) => {
				return of(FlowsActions.selectStep({ step: params.newTrigger }));
			})
		);
	});

	deleteStep = createEffect(() => {
		return this.actions$.pipe(
			ofType(FlowsActions.deleteStep),
			concatLatestFrom(() => [
				this.store.select(BuilderSelectors.selectCurrentTabState),
				this.store.select(BuilderSelectors.selectCurrentStepName),
			]),
			switchMap(([{ stepName: stepToDeleteName }, state, currentStepName]) => {
				if (state && currentStepName === stepToDeleteName && state.rightSidebar.type === RightSideBarType.EDIT_STEP) {
					return of(
						FlowsActions.setRightSidebar({
							sidebarType: RightSideBarType.NONE,
							props: {},
						})
					);
				}
				return EMPTY;
			})
		);
	});

	addStep = createEffect(() => {
		return this.actions$.pipe(
			ofType(FlowsActions.addStep),
			concatLatestFrom(() => this.store.select(BuilderSelectors.selectCurrentFlowId)),
			switchMap(([{ newAction }]) => {
				return of(FlowsActions.selectStep({ step: newAction }));
			})
		);
	});

	handleRunSnackbar$ = createEffect(
		() => {
			return this.actions$.pipe(
				ofType(FlowsActions.selectFlow),
				concatLatestFrom(() => this.store.select(BuilderSelectors.selectCurrentFlowRun)),
				tap(([{ flowId }, run]) => {
					if (run === undefined) {
						this.snackBar.dismiss();
					} else {
						this.snackBar.openFromComponent(TestRunBarComponent, {
							duration: undefined,
							data: { flowId: flowId },
						});
					}
				})
			);
		},
		{
			dispatch: false,
		}
	);

	setRun = createEffect(() => {
		return this.actions$.pipe(
			ofType(FlowsActions.setRun),
			concatLatestFrom(() => this.store.select(BuilderSelectors.selectCurrentStepName)),
			switchMap(([{}, stepName]) => {
				if (stepName != null) {
					return of(
						FlowsActions.setLeftSidebar({
							sidebarType: LeftSideBarType.SHOW_RUN,
							props: {},
						})
					);
				}
				return EMPTY;
			})
		);
	});

	exitRun = createEffect(() => {
		return this.actions$.pipe(
			ofType(FlowsActions.exitRun),
			concatLatestFrom(() => this.store.select(BuilderSelectors.selectCurrentLeftSidebar)),
			switchMap(([{ flowId }, leftSideBar]) => {
				if (leftSideBar != null && leftSideBar.type === LeftSideBarType.SHOW_RUN) {
					return of(
						FlowsActions.setLeftSidebar({
							sidebarType: LeftSideBarType.NONE,
							props: {},
						})
					);
				}
				return EMPTY;
			})
		);
	});

	selectPieceOpenLeftsideBar = createEffect(() => {
		return this.actions$.pipe(
			ofType(FlowsActions.selectStep),
			concatLatestFrom(() => [this.store.select(BuilderSelectors.selectCurrentFlowRun)]),
			switchMap(([{ step }, selectedRun]) => {
				if (selectedRun != null) {
					return of(
						FlowsActions.setLeftSidebar({
							sidebarType: LeftSideBarType.SHOW_RUN,
							props: {},
						})
					);
				}
				return EMPTY;
			})
		);
	});

	selectPieceOpenRightSidebar = createEffect(() => {
		return this.actions$.pipe(
			ofType(FlowsActions.selectStep),
			concatLatestFrom(() => [this.store.select(BuilderSelectors.selectCurrentStep)]),
			switchMap(([{ step }, flowItem]) => {
				if (flowItem && flowItem.type === TriggerType.EMPTY) {
					return of(
						FlowsActions.setRightSidebar({
							sidebarType: RightSideBarType.TRIGGER_TYPE,
							props: {},
						})
					);
				}
				return of(
					FlowsActions.setRightSidebar({
						sidebarType: RightSideBarType.EDIT_STEP,
						props: {},
					})
				);
			})
		);
	});

	constructor(
		private pieceBuilderService: PieceBuilderService,
		private flowService: FlowService,
		private store: Store,
		private actions$: Actions,
		private snackBar: MatSnackBar,
		private codeService: CodeService,
		private collectionService: CollectionService
	) {}
}

import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { environment } from '../../../../environments/environment';
import { CollectionVersion } from '../model/piece.interface';
import { forkJoin, map, Observable, of, skipWhile, switchMap, take, tap } from 'rxjs';
import { Flow } from '../model/flow.class';
import { SeekPage } from './seek-page';
import { UUID } from 'angular2-uuid';
import { FlowVersion } from '../model/flow-version.class';
import { InstanceRun } from '../model/instance-run.interface';
import { InstanceRunService } from './instance-run.service';
import { TriggerType } from '../model/enum/trigger-type.enum';
import { FlowTemplateInterface } from '../../flow-builder/model/flow-template.interface';
import { CreateNewFlowModalComponent } from '../../flow-builder/page/flow-builder/flow-right-sidebar/create-new-flow-modal/create-new-flow-modal.component';
import { BuilderSelectors } from '../../flow-builder/store/selector/flow-builder.selector';
import { findDefaultFlowDisplayName } from '../utils';
import { Store } from '@ngrx/store';
import { BsModalRef, BsModalService } from 'ngx-bootstrap/modal';
import { FlowsActions } from '../../flow-builder/store/action/flows.action';
import { RightSideBarType } from '../model/enum/right-side-bar-type.enum';
import { VersionEditState } from '../model/enum/version-edit-state.enum';
import {
	addArtifactsToFormData,
	ArtifactAndItsNameInFormData,
	zipAllArtifacts,
} from '../model/helper/artifacts-zipping-helper';
import { CodeService } from '../../flow-builder/service/code.service';
import { CodeAction } from '../model/flow-builder/actions/code-action.interface';
import { Artifact } from '../../flow-builder/model/artifact.interface';
import { ConfigType } from '../model/enum/config-type';
import { DropdownType } from '../model/enum/config.enum';
import { DynamicDropdownSettings } from '../model/fields/variable/config-settings';

@Injectable({
	providedIn: 'root',
})
export class FlowService {
	private bsModalRef: BsModalRef;

	constructor(
		private instanceRunService: InstanceRunService,
		private store: Store,
		private modalService: BsModalService,
		private http: HttpClient,
		private codeService: CodeService
	) {}

	public showModalFlow() {
		this.bsModalRef = this.modalService.show(CreateNewFlowModalComponent, {
			ignoreBackdropClick: true,
		});
		this.bsModalRef.content.selectedTemplate
			.pipe(
				take(1),
				switchMap(template => {
					if (template == undefined) {
						return of(undefined);
					}
					let flowTemplate: FlowTemplateInterface = template as FlowTemplateInterface;
					return this.createFlowTemplate(flowTemplate);
				})
			)
			.subscribe();
	}

	public createFlowTemplate(flowTemplate: FlowTemplateInterface) {
		return forkJoin({
			piece: this.store.select(BuilderSelectors.selectCurrentCollection).pipe(take(1)),
			flows: this.store.select(BuilderSelectors.selectFlows).pipe(take(1)),
		})
			.pipe(
				switchMap(pieceWithFlows => {
					let flowDisplayName = findDefaultFlowDisplayName(pieceWithFlows.flows);
					return this.create(pieceWithFlows.piece.id, {
						flowDisplayName: flowDisplayName,
						template: flowTemplate,
					});
				})
			)
			.pipe(
				map(response => {
					if (response != undefined) {
						this.store
							.select(BuilderSelectors.selectCurrentFlowId)
							.pipe(skipWhile(f => f != response.id))
							.pipe(take(1))
							.pipe(
								switchMap(f => {
									return this.store
										.select(BuilderSelectors.selectCurrentTabState)
										.pipe(skipWhile(f => f == undefined))
										.pipe(take(1));
								})
							)
							.subscribe(tab => {
								if (response.lastVersion.trigger?.type === TriggerType.EMPTY) {
									this.store.dispatch(
										FlowsActions.setRightSidebar({
											sidebarType: RightSideBarType.TRIGGER_TYPE,
											props: {},
										})
									);
								}
							});
						this.store.dispatch(FlowsActions.addFlow({ flow: response }));
					}
					return response;
				})
			);
	}

	create(colelctionId: UUID, request: { flowDisplayName: string; template: FlowTemplateInterface }): Observable<Flow> {
		const formData = new FormData();
		let clonedTemplate: FlowTemplateInterface = JSON.parse(JSON.stringify(request.template));
		let flowVersion: FlowVersion = new FlowVersion({
			epochCreationTime: 0,
			epochUpdateTime: 0,
			// IGNORED
			flowId: UUID.UUID(),
			// IGNORED
			id: UUID.UUID(),
			// IGNORED
			state: VersionEditState.DRAFT,
			valid: false,
			access: clonedTemplate.version.access,
			displayName: request.flowDisplayName,
			description: request.flowDisplayName + ' description',
			configs: clonedTemplate.version.configs,
			trigger: clonedTemplate.version.trigger,
		});
		const codeActions: CodeAction[] = flowVersion.codeActions();
		const codeActionsArtifacts: Artifact[] = new Array(codeActions.length);
		codeActionsArtifacts.fill(this.codeService.helloWorld());
		const artifacts$ = zipAllArtifacts(
			codeActionsArtifacts.map((art, idx) => {
				return { artifact: art, name: codeActions[idx].name };
			})
		);

		formData.append(
			'flow',
			new Blob(
				[
					JSON.stringify({
						version: flowVersion,
					}),
				],
				{ type: 'application/json' }
			)
		);

		const createFlow$ = this.http.post<Flow>(environment.apiUrl + '/collections/' + colelctionId + '/flows', formData);
		if (artifacts$.length == 0) {
			return createFlow$;
		}
		return forkJoin(artifacts$).pipe(
			tap(zippedFilesAndTheirNames => {
				addArtifactsToFormData(zippedFilesAndTheirNames, formData);
			}),
			switchMap(() => {
				return createFlow$;
			})
		);
	}

	get(flowId: UUID): Observable<Flow> {
		return this.http.get<Flow>(environment.apiUrl + '/flows/' + flowId);
	}

	getVersion(flowVersionId: UUID): Observable<FlowVersion> {
		return this.http.get<FlowVersion>(environment.apiUrl + '/flows/versions/' + flowVersionId);
	}

	listByPiece(integrationId: UUID, limit: number): Observable<SeekPage<Flow>> {
		return this.http.get<SeekPage<Flow>>(
			environment.apiUrl + '/collections/' + integrationId + '/flows?limit=' + limit
		);
	}

	listVersionsByFlowId(flowID: UUID): Observable<FlowVersion[]> {
		return this.http.get<FlowVersion[]>(environment.apiUrl + '/flows/' + flowID + '/versions');
	}

	listByPieceVersion(pieceVersion: CollectionVersion): Observable<FlowVersion[]> {
		return forkJoin(pieceVersion.flowsVersionId.map(item => this.getVersion(item)));
	}

	count(integrationId: UUID): Observable<number> {
		return this.http.get<number>(environment.apiUrl + '/collections/' + integrationId + '/flows/count');
	}

	delete(workflowId: UUID): Observable<void> {
		return this.http.delete<void>(environment.apiUrl + '/flows/' + workflowId);
	}

	update(flowId: UUID, flow: FlowVersion): Observable<Flow> {
		const formData = new FormData();
		let clonedFlowVersion: FlowVersion = FlowVersion.clone(flow);
		formData.append(
			'flow',
			new Blob([JSON.stringify(clonedFlowVersion)], {
				type: 'application/json',
			})
		);
		const dirtyStepsArtifacts = this.codeService.getDirtyArtifactsForFlowSteps(flowId);
		const artifactsAndTheirNames: ArtifactAndItsNameInFormData[] = [
			...this.getDynamicDropdownConfigsArtifacts(flow),
			...dirtyStepsArtifacts,
		];

		const updateFlow$ = this.http.put<any>(environment.apiUrl + '/flows/' + flowId + '/versions/latest', formData);
		const artifacts$ = zipAllArtifacts(artifactsAndTheirNames);
		if (artifacts$.length == 0) {
			return updateFlow$;
		}
		return forkJoin(artifacts$).pipe(
			tap(zippedFilesAndTheirNames => {
				addArtifactsToFormData(zippedFilesAndTheirNames, formData);
			}),
			switchMap(() => {
				const updateFlowWithArtifacts$ = this.http.put<any>(
					environment.apiUrl + '/flows/' + flowId + '/versions/latest',
					formData
				);
				return updateFlowWithArtifacts$;
			}),
			tap(() => {
				this.codeService.unmarkDirtyArtifactsInFlowStepsCache(flowId);
			})
		);
	}

	execute(
		collectionVersionId: UUID,
		flowVersionId,
		request: { configs: Map<String, Object>; trigger: any }
	): Observable<InstanceRun> {
		console.log(request.configs);
		return this.http
			.post<any>(
				environment.apiUrl +
					'/collection-versions/' +
					collectionVersionId +
					'/flow-versions/' +
					flowVersionId +
					'/runs',
				request
			)
			.pipe(
				switchMap(value => {
					// TODO REMOVE AFTER RELEASE NEW WORKERS
					if (value.runId !== undefined) {
						return this.instanceRunService.get(value.runId);
					} else {
						return of(value);
					}
				})
			);
	}
	getDynamicDropdownConfigsArtifacts(flow: FlowVersion) {
		const artifacts: ArtifactAndItsNameInFormData[] = [];
		flow.configs.forEach(config => {
			const settings = config.settings as DynamicDropdownSettings;
			if (config.type === ConfigType.DROPDOWN && settings.dropdownType == DropdownType.DYNAMIC) {
				if (settings.artifactContent) artifacts.push({ artifact: settings.artifactContent, name: config.key });
			}
		});
		return artifacts;
	}
}

