{
		title: 'Start from scratch',
		description: 'Start building your collection form scratch.',
		icon: '/assets/img/custom/template/add-flow-rounded.svg',
		version: {
			access: 'PRIVATE',
			configs: [],
			trigger: {
				yOffsetFromLastNode: 0,
				name: 'trigger',
				displayName: 'Empty Trigger',
				type: TriggerType.EMPTY,
				settings: {},
			},
