@Injectable({
	providedIn: 'root',
})
export class NavigationService {
	isInBuilder = false;
	lastPageTitle = '';
	private selectedMenuIndex: BehaviorSubject<any> = new BehaviorSubject(0);
	private selectedRouteIndex: BehaviorSubject<any> = new BehaviorSubject(undefined);
	private submenuState: BehaviorSubject<any> = new BehaviorSubject(false);
	public loading: BehaviorSubject<boolean> = new BehaviorSubject<boolean>(false);
	public sidebarRoutes = [
		{
			id: 'flows',
			icon: '/assets/img/custom/sidebar/pieces.svg',
			disabledIcon: '/assets/img/custom/sidebar/disabled/disabled-flows.svg',
			text: 'Flows',
			link: '/flows',
			submenu: false,
			color: '#af6cd9',
			submenuItems: [],
			hover: false,
		},
		{
			id: 'accounts',
			icon: '/assets/img/custom/sidebar/accounts.svg',
			disabledIcon: '/assets/img/custom/sidebar/disabled/disabled-accounts.svg',
			text: 'Accounts',
			submenu: true,
			color: '#6385dc',
			submenuItems: [
				{ id: 'accounts', text: 'All Accounts', link: '/accounts' },
				{ id: 'accounts', text: 'Instances', link: '/instances' },
				{ id: 'accounts', text: 'Runs', link: '/runs' },
			],
			hover: false,
		},
		{
			id: 'settings',
			icon: '/assets/img/custom/sidebar/settings.svg',
			disabledIcon: '/assets/img/custom/sidebar/disabled/disabled-settings.svg',
			text: 'Settings',
			submenu: true,
			color: '#5fd2b0',
			submenuItems: [
				{
					id: 'authentication',
					text: 'Authentication',
					link: '/authentication',
				},
				{ id: 'settings', text: 'Environments', link: '/environments' },
				{ id: 'settings', text: 'Events', link: '/events' },
				{ id: 'settings', text: 'API Keys', link: '/api-keys' },
			],
			hover: false,
		},
	];

	constructor(private router: Router, private titleService: Title) {
		this.router.events.pipe(filter(event => event instanceof RouterEvent)).subscribe((event: any) => {
			this.navigationInterceptor(event);
		});
	}

	public navigatingToBuilder(url: string) {
		return url.indexOf('/flows/') != -1;
	}
	public setTitle(pageTitle: string) {
		if (pageTitle != 'Loading') {
			this.lastPageTitle = pageTitle;
		}
		this.titleService.setTitle('AP - ' + pageTitle);
	}
	private navigationInterceptor(event: RouterEvent): void {
		if (event instanceof NavigationStart) {
			this.setTitle('Loading');
			this.loading.next(true);
		}
		if (event instanceof NavigationEnd) {
			this.loading.next(false);
		}
		if (event instanceof NavigationCancel) {
			this.setTitle(this.lastPageTitle);
			this.loading.next(false);
		}
		if (event instanceof NavigationError) {
			this.setTitle(this.lastPageTitle);
			this.loading.next(false);
		}
	}

	public setSubmenuState(open: boolean) {
		this.submenuState.next(open);
	}

	public getSubmenuState() {
		return this.submenuState;
	}

	public setSelectedRoute(request: { menu: number; submenu: number | undefined } | undefined) {
		this.selectedRouteIndex.next(request);
	}

	public getSelectedRoute() {
		return this.selectedRouteIndex;
	}

	public setSelectedMenuIndex(index: number | undefined) {
		this.selectedMenuIndex.next(index);
	}

	public getSelectedMenuIndex() {
		return this.selectedMenuIndex;
	}
}

import { Injectable } from '@angular/core';
import { environment } from '../../../../environments/environment';
import { HttpClient } from '@angular/common/http';
import { OAuth2Response } from '../model/fields/variable/subfields/oauth2-response.interface';
import { UUID } from 'angular2-uuid';
import { map, Observable, switchMap } from 'rxjs';

@Injectable({
	providedIn: 'root',
})
export class Oauth2Service {
	private currentlyOpenPopUp: Window | null = null;

	constructor(private httpClient: HttpClient) {}

	public claimWithSecret(request: { code: string; clientId: string; tokenUrl: string; clientSecret: string }) {
		return this.httpClient.post<OAuth2Response>(environment.apiUrl + '/oauth2/claim-with-secret', request);
	}

	public openPopup(request: {
		authUrl: string;
		clientId: string;
		clientSecret: string;
		scope: string;
		tokenUrl: string;
		responseType: string;
	}): Observable<any> {
		this.currentlyOpenPopUp?.close();
		const winTarget = '_blank';
		const winFeatures =
			'resizable=no, toolbar=no,left=100, top=100, scrollbars=no, menubar=no, status=no, directories=no, location=no, width=600, height=800';
		const redirect_uri = environment.redirectUrl;
		const url =
			request.authUrl +
			'?response_type=' +
			request.responseType +
			'&client_id=' +
			request.clientId +
			'&redirect_uri=' +
			redirect_uri +
			'&access_type=offline' +
			'&state=' +
			UUID.UUID() +
			'&prompt=consent' +
			'&scope=' +
			request.scope;
		const popup = window.open(url, winTarget, winFeatures);
		this.currentlyOpenPopUp = popup;
		const codeObs$ = new Observable<any>(observer => {
			window.addEventListener('message', function (event) {
				if (environment.redirectUrl.startsWith(event.origin)) {
					if (event.data != undefined) {
						event.data.code = decodeURIComponent(event.data.code);
						observer.next(event.data);
						popup?.close();
						observer.complete();
					} else {
						observer.error('No code returned');
						popup?.close();
						observer.complete();
					}
				}
			});
		});

		return codeObs$.pipe(
			switchMap(params => {
				if (params != undefined && params.code != undefined) {
					return this.claimWithSecret({
						code: decodeURIComponent(params.code),
						clientId: request.clientId,
						clientSecret: request.clientSecret,
						tokenUrl: request.tokenUrl,
					}).pipe(
						map(value => {
							delete params['code'];
							value.auth_response = params;
							return value;
						})
					);
				}

				throw new Error(`params for openPopUp is empty or the code is, params:${params}`);
			})
		);
	}
}

