export class Config {
	key: string;
	type: ConfigType;
	label: string;
	hintText?: string;
	settings: DropdownSettings | DynamicDropdownSettings | OAuth2ConfigSettings | BaseConfigSettings | ShortTextSettings;
	source: ConfigSource;
	value: any;
	collectionVersionId?: UUID;
	flowVersionId?: UUID;
	placeholder?: string;
