export const ACCEPTED_DISTANCE_BETWEEN_DROP_POINT_AND_ADD_BUTTON = 250;

import { FlowItem } from '../../common-layout/model/flow-builder/flow-item';
import { TriggerType } from '../../common-layout/model/enum/trigger-type.enum';
import { ActionType } from '../../common-layout/model/enum/action-type.enum';
import { Action } from '../../common-layout/model/flow-builder/actions/action.interface';
import { Trigger } from '../../common-layout/model/flow-builder/trigger/trigger.interface';
import { LoopOnItemActionInterface } from '../../common-layout/model/flow-builder/actions/loop-action.interface';

export class FlowStructureUtil {
	constructor() {}

	static isAction(piece: FlowItem): boolean {
		let type = piece.type;
		if (type == undefined) {
			return false;
		}
		return Object.values(ActionType).includes(type as ActionType);
	}

	static isTrigger(piece: FlowItem): boolean {
		let type = piece.type;
		if (type == undefined) {
			return false;
		}
		return Object.values(TriggerType).includes(type as TriggerType);
	}

	public static findParent(
		mainPiece: Action | Trigger | undefined,
		targetStepName: string
	): Action | Trigger | undefined {
		if (mainPiece === undefined) {
			return undefined;
		}
		let branches = FlowStructureUtil.branches(mainPiece);
		for (let i = 0; i < branches.length; ++i) {
			let parent = this.findParent(branches[i], targetStepName);
			if (branches[i].name === targetStepName) {
				return mainPiece;
			}
			if (parent !== undefined) {
				return parent;
			}
		}
		return undefined;
	}

	public static traverseAllSteps(mainPiece: Action | Trigger | undefined): FlowItem[] {
		if (mainPiece === undefined) {
			return [];
		}
		let steps: FlowItem[] = [mainPiece];
		let branches = FlowStructureUtil.branches(mainPiece);
		for (let i = 0; i < branches.length; ++i) {
			let subSteps = this.traverseAllSteps(branches[i]);
			for (let i = 0; i < subSteps.length; ++i) {
				steps.push(subSteps[i]);
			}
		}
		return steps;
	}

	public static findStep(
		mainPiece: Action | Trigger | undefined,
		targetStepName: string
	): Action | Trigger | undefined {
		if (mainPiece === undefined) {
			return undefined;
		}
		if (mainPiece.name === targetStepName) {
			return mainPiece;
		}
		let branches = FlowStructureUtil.branches(mainPiece);
		for (let i = 0; i < branches.length; ++i) {
			let action = this.findStep(branches[i], targetStepName);
			if (action !== undefined) {
				return action;
			}
		}
		return undefined;
	}

	public static branches(mainPiece: Action | Trigger): Action[] {
		let branches: Action[] = [];
		if (mainPiece.type === ActionType.BRANCH) {
			let branchData = mainPiece as Action;
			for (let i = 0; i < branchData.settings.branches.length; ++i) {
				let nextAction = branchData.settings.branches[i].nextAction;
				if (nextAction) {
					branches.push(nextAction);
				}
			}
		}
		if (mainPiece.type === ActionType.LOOP_ON_ITEMS) {
			let loopAction = mainPiece as LoopOnItemActionInterface;
			if (loopAction.firstLoopAction) {
				branches.push(loopAction.firstLoopAction);
			}
		}
		let nextAction = mainPiece.nextAction;
		if (nextAction) {
			branches.push(nextAction);
		}
		return branches;
	}
}

import { VersionEditState } from './enum/version-edit-state.enum';
import { UUID } from 'angular2-uuid';
import { Trigger } from './flow-builder/trigger/trigger.interface';
import { Action } from './flow-builder/actions/action.interface';
import { ActionType } from './enum/action-type.enum';
import { CodeAction } from './flow-builder/actions/code-action.interface';
import { AddButtonType } from './enum/add-button-type';
import { LoopOnItemActionInterface } from './flow-builder/actions/loop-action.interface';
import { FlowStructureUtil } from '../../flow-builder/service/flowStructureUtil';
import { Config } from './fields/variable/config';

export class FlowVersion {
	id: UUID;
	flowId: UUID;
	displayName: string;
	description: string;
	state: VersionEditState;
	configs: Config[];
	epochCreationTime: number;
	epochCreationTimeFormatted?: string;
	epochUpdateTime: number;
	trigger?: Trigger;
	versionNumber?: number;
	access: any;
	valid: boolean;

	constructor(obj: {
		id: UUID;
		flowId: UUID;
		displayName: string;
		description: string;
		state: VersionEditState;
		configs: Config[];
		epochCreationTime: number;
		epochUpdateTime: number;
		trigger: Trigger;
		access: any;
		valid: boolean;
	}) {
		this.id = obj.id;
		this.valid = obj.valid;
		this.flowId = obj.flowId;
		this.displayName = obj.displayName;
		this.description = obj.description;
		this.state = obj.state;
		this.configs = obj.configs;
		this.epochCreationTime = obj.epochCreationTime;
		this.epochUpdateTime = obj.epochUpdateTime;
		this.trigger = obj.trigger;
		this.access = obj.access;
	}

	public static clone(flow: FlowVersion): FlowVersion {
		return new FlowVersion(JSON.parse(JSON.stringify(flow)));
	}

	public updateStep(targetStepName: string, updatedValue: Action | Trigger): FlowVersion {
		let step = FlowStructureUtil.findStep(this.trigger, targetStepName);
		if (step !== undefined) {
			step.displayName = updatedValue.displayName;
			step.type = updatedValue.type;
			step.name = updatedValue.name;
			step.valid = updatedValue.valid;
			step.settings = updatedValue.settings;
		}
		this.valid = this.isValid();
		return this;
	}

	public isValid(): boolean {
		return FlowStructureUtil.traverseAllSteps(this.trigger).findIndex(f => f.valid == false) == -1;
	}

	public dropPiece(draggedPieceName: string, newParentName: string) {
		let draggedPiece = FlowStructureUtil.findStep(this.trigger, draggedPieceName);
		let parentDraggedPiece = FlowStructureUtil.findParent(this.trigger, draggedPieceName);
		let newParentPiece = FlowStructureUtil.findStep(this.trigger, newParentName);
		if (draggedPiece && newParentPiece && parentDraggedPiece) {
			parentDraggedPiece.nextAction = draggedPiece.nextAction;
			draggedPiece.nextAction = newParentPiece.nextAction;
			newParentPiece.nextAction = draggedPiece as Action;
		}
	}

	public replaceTrigger(trigger: Trigger): FlowVersion {
		this.trigger!.type = trigger.type;
		this.trigger!.displayName = trigger.displayName;
		this.trigger!.name = trigger.name;
		this.trigger!.settings = trigger.settings;
		this.trigger!.valid = trigger.valid;
		this.valid = this.isValid();
		return this;
	}

	public addNewChild(
		targetStepName: string,
		newStep: Action,
		buttonType: AddButtonType = AddButtonType.NEXT_ACTION
	): FlowVersion {
		let step = FlowStructureUtil.findStep(this.trigger, targetStepName);
		let cloneNewStep: Action = JSON.parse(JSON.stringify(newStep));
		if (step) {
			if (step.type === ActionType.LOOP_ON_ITEMS && buttonType === AddButtonType.FIRST_LOOP_ACTION) {
				let loop: LoopOnItemActionInterface = step as LoopOnItemActionInterface;
				cloneNewStep.nextAction = loop.firstLoopAction;
				loop.firstLoopAction = cloneNewStep;
			} else {
				cloneNewStep.nextAction = step?.nextAction;
				step.nextAction = cloneNewStep;
			}
		}
		this.valid = this.isValid();
		return this;
	}

	public deleteStep(targetStepName: string) {
		let step = FlowStructureUtil.findStep(this.trigger, targetStepName);
		let parent = FlowStructureUtil.findParent(this.trigger, targetStepName);
		if (step && parent) {
			if (parent.type === ActionType.LOOP_ON_ITEMS) {
				let loopItem = parent as LoopOnItemActionInterface;
				if (
					loopItem.firstLoopAction !== undefined &&
					loopItem.firstLoopAction !== null &&
					loopItem.firstLoopAction.name === targetStepName
				) {
					loopItem.firstLoopAction = step?.nextAction;
				}
			}
			if (parent.nextAction !== undefined && parent.nextAction !== null && parent.nextAction.name === targetStepName) {
				parent.nextAction = step?.nextAction;
			}
		}
		this.valid = this.isValid();
		return this;
	}

	public findAvailableName(stepPrefix: string) {
		let steps = FlowStructureUtil.traverseAllSteps(this.trigger);
		let number = 1;
		while (true) {
			let exist = false;
			for (let i = 0; i < steps.length; ++i) {
				let action = steps[i] as Action;
				if (action.name === stepPrefix.toString().toLowerCase() + '_' + number) {
					exist = true;
					break;
				}
			}
			if (exist) {
				number++;
			} else {
				break;
			}
		}
		return stepPrefix.toString().toLowerCase() + '_' + number;
	}

	public codeActions(): CodeAction[] {
		return FlowStructureUtil.traverseAllSteps(this.trigger)
			.filter(f => f.type === ActionType.CODE)
			.map(f => f as CodeAction);
	}
}

