import { Component, EventEmitter, Input, Output } from '@angular/core';
import { DataRow } from './data-row';
import { DataHeader } from './data-header';
import { Router } from '@angular/router';

@Component({
	selector: 'app-responsive-table',
	templateUrl: './responsive-table.component.html',
	styleUrls: ['./responsive-table.component.css'],
})
export class ResponsiveTableComponent {
	_data: DataRow[];

	get data(): DataRow[] {
		return this._data;
	}

	@Input() set data(value: DataRow[]) {
		this._data = value;
	}

	@Input() headers: DataHeader[];
	@Output() actions: EventEmitter<{ action: string; index: number }> = new EventEmitter<{
		action: string;
		index: number;
	}>();

	hoverIndex: number;

	constructor(private router: Router) {}

	alignClass(align: string | undefined) {
		if (align === 'center') {
			return 'text-center';
		}
		if (align === 'right') {
			return 'text-right';
		}
		return '';
	}

	createStyle(header: DataHeader) {
		return {
			width: header.width,
		};
	}

	emitAction(actionToReturn: string | undefined, index: number) {
		if (actionToReturn) {
			this.actions.emit({ action: actionToReturn, index: index });
		}
	}

	openRoute(route: { route: string; extra: any } | undefined) {
		if (route) {
			this.router.navigate([route.route], route.extra);
		}
	}

	dataStyle(column: any) {
		return {
			cursor: column.route ? 'pointer' : '',
		};
	}

	dataClassList(column: any, index: number) {
		let classList: string[] = [];
		if (column.align) {
			classList.push(this.alignClass(column.align));
		}
		if (column.route && this.hoverIndex === index) {
			classList.push('hyper-number');
		}
		return classList.join(' ');
	}
}

import { Component, OnInit } from '@angular/core';

import { combineLatest, map, Observable } from 'rxjs';
import { InstanceRunStatus } from '../../../../../common-layout/model/enum/instance-run-status';
import { UUID } from 'angular2-uuid';
import { ActionStatus } from '../../../../../common-layout/model/enum/action-status';
import { InstanceRun, StepResult } from '../../../../../common-layout/model/instance-run.interface';
import { TimeHelperService } from '../../../../../common-layout/service/time-helper.service';
import { LeftSideBarType } from 'src/app/layout/common-layout/model/enum/left-side-bar-type.enum';
import { BuilderSelectors } from '../../../../store/selector/flow-builder.selector';
import { Store } from '@ngrx/store';
import { IterationDetailsService } from './iteration-details.service';
import { FlowItem } from 'src/app/layout/common-layout/model/flow-builder/flow-item';
import { FlowsActions } from 'src/app/layout/flow-builder/store/action/flows.action';

@Component({
	selector: 'app-run-details',
	templateUrl: './run-details.component.html',
	styleUrls: ['./run-details.component.scss'],
})
export class RunDetailsComponent implements OnInit {
	runResults: {
		result: StepResult;
		stepName: string;
	}[] = [];
	flowId: UUID;
	logs$: Observable<
		| {
				selectedStep: FlowItem | undefined | null;
				selectedRun: InstanceRun | undefined;
				runResults: {
					result: StepResult;
					stepName: string;
				}[];
		  }
		| undefined
		| null
	>;
	constructor(
		private store: Store,
		public timeHelperService: TimeHelperService,
		public iterationDetailsService: IterationDetailsService
	) {}

	ngOnInit(): void {
		const selectedStep$ = this.store.select(BuilderSelectors.selectCurrentStep);
		const run$ = this.store.select(BuilderSelectors.selectCurrentFlowRun);
		this.logs$ = combineLatest({
			selectedFlowRun: run$,
			selectedStep: selectedStep$,
		}).pipe(
			map(result => {
				if (result.selectedFlowRun && result.selectedFlowRun.status !== InstanceRunStatus.RUNNING) {
					if (this.runResults.length === 0) {
						this.runResults = this.createStepResultsForDetailsAccordion(result.selectedFlowRun);
					}

					return {
						selectedRun: result.selectedFlowRun,
						runResults: this.runResults,
						selectedStep: result.selectedStep,
					};
				}
				this.runResults = [];
				return undefined;
			})
		);
	}

	copyStepResultAndFormatDuration(stepResult: StepResult) {
		const copiedStep: StepResult = JSON.parse(JSON.stringify(stepResult));
		copiedStep.duration = this.formatStepDuration(copiedStep.duration);
		return copiedStep;
	}
	formatStepDuration(duration: number) {
		const durationInSeconds = (duration /= 1000);
		const durationFloatingPointFixed = durationInSeconds.toFixed(3);
		return Number.parseFloat(durationFloatingPointFixed);
	}

	closeLeftSideBar() {
		this.store.dispatch(
			FlowsActions.setLeftSidebar({
				sidebarType: LeftSideBarType.NONE,
				props: {},
			})
		);
	}

	public get actionStatusEnum() {
		return ActionStatus;
	}

	public get InstanceRunStatus() {
		return InstanceRunStatus;
	}

	createStepResultsForDetailsAccordion(run: InstanceRun): {
		result: StepResult;
		stepName: string;
	}[] {
		const stepNames = Object.keys(run.state.steps);
		return stepNames.map(name => {
			let result = run.state.steps[name];
			if (!result.output) {
				result = { ...result, output: result.errorMessage };
			}
			return {
				result: result,
				stepName: name,
			};
		});
	}
}

