import { AfterViewInit, Component, Input, OnChanges, OnInit, SimpleChanges } from '@angular/core';
import { FormControl } from '@angular/forms';
import { MatExpansionPanel } from '@angular/material/expansion';

import { Store } from '@ngrx/store';

import { map, Observable, startWith } from 'rxjs';
import { ActionStatus } from 'src/app/layout/common-layout/model/enum/action-status';
import { StepResult } from 'src/app/layout/common-layout/model/instance-run.interface';
import { IterationDetailsService } from '../iteration-details.service';
import { FlowsActions } from '../../../../../store/action/flows.action';

@Component({
	selector: 'app-step-result',
	templateUrl: './step-result.component.html',
	styleUrls: ['./step-result.component.scss'],
})
export class StepResultComponent implements OnInit, AfterViewInit, OnChanges {
	@Input() stepNameAndResult: { stepName: string; result: StepResult };
	@Input() selectedStepName: string | undefined;
	@Input() nestingLevel = 0;
	@Input() isTrigger = false;
	nestingLevelPadding: string = '0px';
	finishedBuilding = false;
	iterationIndexControl = new FormControl(1);
	iteration$: Observable<{ stepName: string; result: StepResult }[] | undefined>;
	iterationsAccordionList: { stepName: string; result: StepResult }[][] = [];
	constructor(private store: Store, private iterationDetailsService: IterationDetailsService) {}

	ngOnInit(): void {
		if (this.stepNameAndResult.result.iterations) {
			this.stepNameAndResult.result.iterations.forEach(iteration => {
				this.iterationsAccordionList.push(this.createStepResultsForDetailsAccordion(iteration));
			});
			this.iteration$ = this.iterationIndexControl.valueChanges.pipe(
				startWith(1),
				map(newIndexString => {
					if (newIndexString === '') {
						return this.iterationsAccordionList[0];
					}
					const newIndex = Number.parseInt(newIndexString);
					if (!newIndex) {
						return undefined;
					}
					return this.iterationsAccordionList[newIndex - 1];
				})
			);
		}
		this.nestingLevelPadding = `${this.nestingLevel * 25}px`;
	}
	ngAfterViewInit(): void {
		setTimeout(() => {
			this.finishedBuilding = true;
		}, 1);
	}
	ngOnChanges(changes: SimpleChanges): void {
		if (
			this.selectedStepName === this.stepNameAndResult.stepName &&
			this.iterationDetailsService.currentStepResult$.value !== this.stepNameAndResult.result
		) {
			this.iterationDetailsService.currentStepResult$.next(this.stepNameAndResult.result);
		}
	}
	get ActionStatus() {
		return ActionStatus;
	}

	selectStepOrToggleExpansionPanel($event: MouseEvent, expansionPanel: MatExpansionPanel) {
		if (this.selectedStepName !== this.stepNameAndResult.stepName) {
			this.store.dispatch(
				FlowsActions.selectStepByName({
					stepName: this.stepNameAndResult.stepName,
				})
			);
		} else if (expansionPanel) {
			expansionPanel.toggle();
		}

		$event.stopPropagation();
	}

	createStepResultsForDetailsAccordion(iteration: { [key: string]: StepResult }): {
		result: StepResult;
		stepName: string;
	}[] {
		const iterationStepsNames = Object.keys(iteration);
		return iterationStepsNames.map(stepName => {
			return {
				stepName: stepName,
				result: iteration[stepName],
			};
		});
	}
	indexSearchClicked($event: MouseEvent) {
		$event.stopPropagation();
		this.store.dispatch(
			FlowsActions.selectStepByName({
				stepName: this.stepNameAndResult.stepName,
			})
		);
	}
}

