import { Component, EventEmitter, Inject, OnInit, Output } from '@angular/core';
import { InstanceRunStatus } from '../../../../common-layout/model/enum/instance-run-status';
import { initializedRun, InstanceRun } from '../../../../common-layout/model/instance-run.interface';
import { Store } from '@ngrx/store';
import { BuilderSelectors } from '../../../store/selector/flow-builder.selector';
import { filter, interval, Observable, of, switchMap, takeWhile, tap } from 'rxjs';
import { MatSnackBarRef, MAT_SNACK_BAR_DATA } from '@angular/material/snack-bar';
import { FlowsActions } from '../../../store/action/flows.action';
import { UUID } from 'angular2-uuid';
import { InstanceRunService } from 'src/app/layout/common-layout/service/instance-run.service';

@Component({
	selector: 'app-test-run-bar',
	templateUrl: './test-run-bar.component.html',
	styleUrls: ['./test-run-bar.component.scss'],
})
export class TestRunBarComponent implements OnInit {
	constructor(
		private snackbarRef: MatSnackBarRef<TestRunBarComponent>,
		private store: Store,
		private instanceRunService: InstanceRunService,
		@Inject(MAT_SNACK_BAR_DATA) public data: { flowId: UUID }
	) {}
	hideExit$: Observable<boolean> = of(false);
	selectedRun$: Observable<InstanceRun | undefined | null>;
	exitRun$: Observable<void> = new Observable<void>();
	instanceRunStatusChecker$: Observable<InstanceRun>;
	@Output()
	exitButtonClicked: EventEmitter<void> = new EventEmitter();

	ngOnInit(): void {
		this.hideExit$ = this.store.select(BuilderSelectors.selectInstanceRunView);
		this.selectedRun$ = this.store.select(BuilderSelectors.selectCurrentFlowRun).pipe(
			filter(run => JSON.stringify(run) !== JSON.stringify(initializedRun)),
			tap(run => {
				if (run && run.status === InstanceRunStatus.RUNNING) {
					this.setStatusChecker(run.id);
				}
			})
		);
		this.exitRun$ = this.exitButtonClicked.pipe(
			tap(() => {
				this.snackbarRef.dismiss();
				//wait for animation to be done
				setTimeout(() => {
					this.store.dispatch(FlowsActions.exitRun({ flowId: this.data.flowId }));
				}, 150);
			})
		);
	}
	setStatusChecker(runId: UUID) {
		this.instanceRunStatusChecker$ = interval(1500).pipe(
			switchMap(() => this.instanceRunService.get(runId)),
			tap(instanceRun => {
				if (instanceRun.status !== InstanceRunStatus.RUNNING && instanceRun) {
					this.store.dispatch(
						FlowsActions.setRun({
							flowId: this.data.flowId,
							run: instanceRun,
						})
					);
				}
			}),
			takeWhile(instanceRun => {
				return instanceRun.status === InstanceRunStatus.RUNNING;
			})
		);
	}

	get instanceRunStatus() {
		return InstanceRunStatus;
	}
}

